import React from 'react';
import './pricing-table.scss'
import PricingBox from './PricingBox';

const PricingTable = () => {
  const pricingData = [
    {
      id:1,
      name: 'Basic',
      icon: '',
      content: ['Frontend Builder', 'Regular Support', '1 Year of Update'],
      recommend: false
    }
  ];
  return (
    <div className='pricing-table'>
      <PricingBox/>
    </div>
  );
}

export default PricingTable;
